var title_f37_29_38359="Anatomy of the thoracic outlet";
var content_f37_29_38359=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F59433%7ESURG%2F50430&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F59433%7ESURG%2F50430&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 510px\">",
"   <div class=\"ttl\">",
"    Anatomy of the thoracic outlet",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 490px; height: 398px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The thoracic outlet refers to the confined space between the clavicle and first rib. Structures that pass through this region include the nerves of the brachial plexus, the subclavian artery and subclavian vein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Cervical rib causing thoracic outlet syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 412px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Thoracic outlet syndromes are due to compression of any of the structures (brachial plexus, subclavian artery, subclavian vein) that traverse the confined space between the clavicle and first rib. Anatomic abnormaliaties such as a cervical rib (shown), musculotendinous abnormalities or scarring can contribute to the pathology.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
