var title_f37_29_38363="Comparison of PGHS1 and PGHS2";
var content_f37_29_38363=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F74433&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F74433&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison of COX-1 and COX-2 enzymes and their functions and localization",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        PGHS-1 (COX-1)",
"       </td>",
"       <td class=\"subtitle1\">",
"        PGHS-2 (COX-2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Size",
"       </td>",
"       <td>",
"        65.5 kDa (576 amino acids)",
"       </td>",
"       <td>",
"        65.5 kDa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Regulation",
"       </td>",
"       <td>",
"        Constitutive",
"       </td>",
"       <td>",
"        Inducible (phorbol ester, oncogenes, cytokines; inhibited by glucocorticoids)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subcellular localization",
"       </td>",
"       <td>",
"        Lumenal surface of endoplasmic reticulum (also perinuclear membrane)",
"       </td>",
"       <td>",
"        Lumenal surface of perinuclear membrane (also endoplasmic reticulum)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tissue localization",
"       </td>",
"       <td>",
"        Platelets, endothelial cells, stomach, kidney, and most tissues",
"       </td>",
"       <td>",
"        Prostate, brain, activated macrophages, fibroblasts, and",
"synoviocytes; capable of expression in most tissues with appropriate",
"stimulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Homology",
"       </td>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Approximately 60 percent identical,",
"75 percent homologous, with conservation in heme binding sites, active",
"site (aspirin acetylation site is Serine 530 in PGHS-1, Serine 516 in",
"PGHS-2), glycosylation sites, and the epidermal growth factor domain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Selective inhibitors",
"       </td>",
"       <td>",
"        Valeryl salicylate",
"       </td>",
"       <td colspan=\"1\">",
"        6-methoxy-2-napthyl-acetic acid (active metabolite of Nabumetone), NS-398, DuP-697, Sc-58635, SC-58550, SC-58125",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
