var title_f37_29_38364="WHO diagnostic criteria for HTLV I associated myelopathy";
var content_f37_29_38364=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F77037&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F77037&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    World Health Organization diagnostic criteria for HTLV-I-associated myelopathy (tropical spastic paraparesis)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical Criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Age and sex incidence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mostly sporadic and adult, but sometimes familial; occasionally seen in childhood; females predominant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Onset",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Usually insidious but may be sudden",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Main neurological manifestations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic spastic paraparesis, which usually progresses slowly, sometime remains static after initial progression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Weakness of the lower limbs, more marked proximally",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bladder disturbance usually an early feature; constipation usually occurs later; impotence or decreased libido is common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sensory symptoms such as tingling, pins and needles, burning, etc., are more prominent than objective physical signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Low lumbar pain with radiation to the legs is common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vibration sense is frequently impaired; proprioception is less often affected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperreflexia of the lower limbs, often with clonus and Babinski's sign",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperreflexia of the upper limbs; positive Hoffman's and Tromner signs frequent; weakness may be absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Exaggerated jaw jerk in some patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Less frequent neurological findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebellar signs, optic atrophy, deafness, nystagmus, other",
"cranial nerve deficits, hand tremor, absent or decreased ankle jerk.",
"Convulsions, cognitive impairment, dementia or impaired consciousness",
"are rare.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Muscular atrophy, fasciculations (rare), polymyositis,",
"peripheral neuropathy, polyradiculopathy, cranial neuropathy,",
"meningitis, encephalopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Systemic non-neurological manifestations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pulmonary alveolitis, uveitis, Sjogren's syndrome,",
"arthropathy, vasculitis, ichthyosis, cryoglobulinemia, monoclonal",
"gammopathy, adult T-cell leukemia/lymphoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laboratory Diagnosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Presence of HTLV-1 antibodies or antigens in blood and CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CSF may show mild lymphocyte pleiocytosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lobulated lymphocytes may be present in blood and/or CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mild to moderate increase of protein may be present in CSF",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
